import React from 'react'
import Latestheading from '../Latestheading/Latestheading'
import ArticleItem from './ArticleItem/ArticleItem';
import article from './'
function Article() {
  return (
    <div className='main'>
      <Latestheading data={{ name1: "Latest", name2: "Article" }} />
      <ArticleItem/>
      <ArticleItem/>
      <ArticleItem/>
      <ArticleItem/>
    </div>
  )
}
export default Article;
